  false,\n\t\"url\": null,\n\t\"notes\": \"The Refuge breeding pair survey was conducted
  on the evening of April 29 from 5:40 pm until sunset at 7:40 pm. Weather consisted
  of clear skies, cool temperatures, and a calm breeze. Four FWS staff and six volunteers
  staffed 10 survey stations (see attached map) . A 12' observation platform, which
  greatly increased visibility, was used on the North Pool dike in front of Deer Island.
  Vehicles/towers were used at other sites. The survey was conducted according to
  the attached methodology from the Wildlife Inventory Plan 1992.\",\n\t\"owner_org\":
